import axios from 'axios';

export const registerUser = async () => {

  try {
    const response = await axios.post(`http://api/register`, {

    }).then(response => {
        console.log('success');
        console.log(response.data);
        return response.data;
    })
  } catch (error) {
    console.log(error);

  }
};
